import {
  Box,
  Typography,
  Card,
  CardContent,
  CardHeader,
  CardMedia,
} from "@mui/material";

export default function TourContent({ id, image, info, name, price }) {
  return (
    <Card>
      <CardMedia
        component="img"
        height="194"
        image={image}
        alt="Paella dish"
      />
    </Card>
  );
}
